import React from "react";
import myImg from "../assets/img/11968.jpg";
const Home = () => {
    return (
        <div className="container" >
            <div className="row">

                <div className="col">
                    <p className="fs-1 mt-5">The go-to digital whiteboard for real-time collaboration</p>
                    <p className="fs-5 mt-2">Easily share ideas and collaborate with others—in real-time or asynchronously—with a free online whiteboard from Draw.</p>
                    <button className="btn btn-info"><svg xmlns="http://www.w3.org/2000/svg" width="16" height="" fill="currentColor" class="bi bi-caret-right" viewBox="0 0 16 16">
  <path d="M6 12.796V3.204L11.481 8 6 12.796zm.659.753 5.48-4.796a1 1 0 0 0 0-1.506L6.66 2.451C6.011 1.885 5 2.345 5 3.204v9.592a1 1 0 0 0 1.659.753z"/>
</svg> Start a Whiteboard</button>
                </div>
                <div className="col mt-5" style={ { paddingTop:'10vh'}}>
                    <img src={myImg} alt="" srcset="" className="img-fluid"/>
                </div>

            </div>
        </div>
    );
};

export default Home;
